import '../styles/global.css';
import Nav from './Nav';
import Home from './Home';
import Footer from './Footer';
import { BrowserRouter, Router, Routes, Route } from 'react-router-dom';
function App() {
    return (
        <BrowserRouter>
            <div className="app-container">
                <Nav />
                <Routes>
                    <Route path="/" element={<Home />} />
                </Routes>

                {/* <Footer /> */}
            </div>
        </BrowserRouter>
    );
}

export default App;
